					prgLinuxCommand.METH_StopAllDockers(); // stop all
				ELSIF xJustRestartBTCond THEN
					iStepInit := 11;
					IF prgLinuxCommand.METH_IsDockerBTActive_01() THEN
						prgLinuxCommand.METH_StopBT01();
					END_IF
					IF prgLinuxCommand.METH_IsDockerBTActive_02() THEN
						prgLinuxCommand.METH_StopBT02();
					END_IF
				ELSIF xEverythingOoffCond THEN // alerady everything off
					prgLinuxCommand.METH_StartDoosanDocker();
					iStepInit := 2;
				ELSE
					xInitError := TRUE;
				END_IF
			END_IF
		END_IF		
	(*----------------------------*)
	1: // start doosan
		xStartDoosanCond := 
			prgEIPMapping.METH_IsDoosanSafeOff(DoosanState := prgEIPMapping.DoosanState)
			AND NOT prgLinuxCommand.METH_IsDockerDoosanActive()
			AND NOT prgLinuxCommand.METH_IsDockerBTActive()
		;
		IF xStartDoosanCond THEN
			prgLinuxCommand.METH_StartDoosanDocker(); // start doosan
			iStepInit := 2;
		END_IF
	(*----------------------------*)
	11: // just bt off
		xJustBTOff := 
			NOT prgLinuxCommand.METH_IsDockerBTActive()
		;
		IF xJustBTOff THEN
			iStepInit := 2;
		END_IF
	(*----------------------------*)
	2: // start bt
		xStartBTCOnd := 
			prgEIPMapping.METH_IsDoosanServoOn(DoosanState := prgEIPMapping.DoosanState)
		;
		IF xStartBTCOnd THEN
			xInitError := FALSE;
			IF METH_IsPalletConfig01() THEN
				prgLinuxCommand.METH_StartBT01();
			ELSIF METH_IsPalletConfig02() THEN
				prgLinuxCommand.METH_StartBT02();
			ELSE
				xInitError := TRUE;
			END_IF
			IF NOT xInitError THEN
				iStepInit := iStepInit + 1;
			END_IF
		END_IF
	(*----------------------------*)
	3: // wait finished
		TON_WaitBTOn(IN := TRUE, PT := tWaitBT);
		xBTIsActive := prgLinuxCommand.METH_IsDockerBTActive();
		IF (TON_WaitBTOn.Q AND xBTIsActive) OR xBTIsActive THEN
			TON_WaitBTOn(IN := FALSE);
			iStepInit := iStepInit + 1;
		END_IF
	(*----------------------------*)
	4: // end
		xInitialized := TRUE;
		iStepInit := 0;
		IF NOT xDisableRUN_DebugFlag THEN
			prgROS.METH_SetRun_01(xValue := TRUE);
// 			GVL.g_ROSInterface_01.xRun := TRUE;
			xARunWasGiven := TRUE;
		END_IF
	(*----------------------------*)
END_CASE

