			IF xPickCond THEN
				eStep := step_enum_t.Vision;
			ELSIF xPickCond THEN
				eStep := step_enum_t.Pick;
			ELSIF xPlaceCond THEN
				eStep := step_enum_t.Place;
			END_IF
		ELSIF xDormantCond AND xInitialized THEN
