		dB_deg := arValues[4],
		dC_deg := arValues[5]
	);
ELSIF xConvertFromRPY THEN
	xComputeRotMat := SM3M.SMC_Matrix3_FromRollPitchYaw_deg(
		mR := mR,
		dRoll := arValues[3],
		dPitch := arValues[4],
		dYaw := arValues[5]
	);
ELSIF xConvertFromQuat THEN
	quat.dR := arValues[6];
	quat.dI := arValues[3];
	quat.dJ := arValues[4];
	quat.dK := arValues[5];
	SM3M.SMC_Quat1_To_RotMatrix(
		m := mR,
		q := quat
	);
ELSE
	xIgnoreCart := TRUE;
	sZYZ := '';
	sRPY := '';
	sQuaternion := '';
END_IF

IF NOT xIgnoreCart THEN

	xIsRot := SM3M.SMC_Matrix3_IsRotation(mR := mR, dEpsRel := 0.001);
	(*-----------------------------*)
	// quaternion conversion from matrix
	SM3M.SMC_Quat1_From_RotMatrix(
		m := mR,
		q := q
	);
	rQW := TO_REAL(q.dR);
	rQX := TO_REAL(q.dI);
	rQY := TO_REAL(q.dJ);
	rQZ := TO_REAL(q.dK);
	(*-----------------------------*)
	// RPY conversion from matrix
	xToRPY := SM3M.SMC_Matrix3_ToRollPitchYaw_deg(
		mR := mR,
		dRoll => lrRoll,
		dPitch => lrPitch,
		dYaw => lrYaw
	);
	rRoll := TO_REAL(lrRoll);
	rPitch := TO_REAL(lrPitch);
	rYaw := TO_REAL(lrYaw);
	(*-----------------------------*)
	// ZYZ conversion from matrix
	xToRPY := SM3M.SMC_Matrix3_ToZYZ_deg(
		mR := mR,
		dA_deg => lrA,
		dB_deg => lrB,
		dC_deg => lrC
	);
	rA := TO_REAL(lrA);
	rB := TO_REAL(lrB);
	rC := TO_REAL(lrC);
	(*-----------------------------*)
	IF xConvertFromZYZ OR xConvertFromRPY THEN
		// mm
		rXmm := arValues[0];
		rYmm := arValues[1];
		rZmm := arValues[2];

		// m
		rXMeters := arValues[0]/1000.0;
		rYMeters := arValues[1]/1000.0;
		rZMeters := arValues[2]/1000.0;
	ELSIF xConvertFromQuat THEN
		// mm
		rXmm := arValues[0]*1000.0;
		rYmm := arValues[1]*1000.0;
		rZmm := arValues[2]*1000.0;

		// m
		rXMeters := arValues[0];
		rYMeters := arValues[1];
		rZMeters := arValues[2];
	END_IF

	ACT_Quaternions();
	ACT_RPY();
	ACT_ZYZ();
END_IF

IF xTB_ParseString OR xTB_Convert THEN
	xINVIS_CartResults := TRUE;
	xINVIS_JointsResults := TRUE;
	xConvertToJointRadians := FALSE;
	xConvertToJointDegrees := FALSE;
	xConvertFromQuat := FALSE;
	xConvertFromRPY := FALSE;
	xConvertFromZYZ := FALSE;

	xTB_ParseString := FALSE;
	SysMem.SysMemSet(pDest := ADR(arValues), udiCount := XSIZEOF(arValues), udiValue := 0);
	diLengthValues := STU.StrLenA(pstData := ADR(sValues));
	diInd := 0;
	iStartPos := 0;
	iLength := 0;
	iIndValues := 0;
	WHILE diInd < diLengthValues DO
		sCurrentValue := '';
		uiStartSearch := TO_UINT(diInd);
		iFindInd := STU.StrCaseFindA(pst1 := ADR(sValues), pst2 := ADR(';'), uiSearchStart := uiStartSearch);
		IF iFindInd > 0 THEN
			IF diInd = 0 THEN // first value
				iStartPos := 1;
			ELSE
				iStartPos := TO_INT(diInd);
			END_IF
			iLength := iFindInd - iStartPos;

			STU.StrMidA(
				pstResult := ADR(sCurrentValue),
				uiResultBufferSize := TO_UINT(XSIZEOF(sCurrentValue)),
				pst := ADR(sValues),
				uiInputBufferSize := TO_UINT(XSIZEOF(sValues)),
				iPosition := iStartPos,
				iLength := iLength
			);
			arValues[iIndValues] := STRING_TO_REAL(sCurrentValue);
			iIndValues := iIndValues + 1;

			diInd := TO_DINT(iFindInd + 1);
		ELSE
			IF iStartPos > 0 THEN // last value (no ;)
				iStartPos := TO_INT(diInd);
				iLength := TO_INT(diLengthValues) + 1 - iStartPos;
				STU.StrMidA(
					pstResult := ADR(sCurrentValue),
					uiResultBufferSize := TO_UINT(XSIZEOF(sCurrentValue)),
					pst := ADR(sValues),
					uiInputBufferSize := TO_UINT(XSIZEOF(sValues)),
					iPosition := iStartPos,
					iLength := iLength
				);

				arValues[iIndValues] := STRING_TO_REAL(sCurrentValue);
				iIndValues := iIndValues + 1;
				diInd := diLengthValues;
			END_IF
		END_IF

	END_WHILE

	IF iIndValues > 0 THEN
		CASE eInputType OF
			(*----------------------------------------*)
			// just convert to the other joint convention
			pose_type_t.JointDegrees:
				FOR iIndJoints := 0 TO 5 DO
					arJointsInDegrees[iIndJoints] := arValues[iIndJoints];
				END_FOR
				xConvertToJointRadians := TRUE;
				xINVIS_JointsResults := FALSE;
			pose_type_t.JointRadians:
				FOR iIndJoints := 0 TO 5 DO
					arJointsInRadians[iIndJoints] := arValues[iIndJoints];
				END_FOR
				xConvertToJointDegrees := TRUE;
				xINVIS_JointsResults := FALSE;
			(*----------------------------------------*)
			(*----------------------------------------*)
			// to rotation matrix, then write all three
			pose_type_t.Cart_mm_ZYZ:
				xConvertFromZYZ := TRUE;
				xINVIS_CartResults := FALSE;
			pose_type_t.Cart_mm_RPY:
				xConvertFromRPY := TRUE;
				xINVIS_CartResults := FALSE;
			pose_type_t.Cart_m_quat:
				xConvertFromQuat := TRUE;
				xINVIS_CartResults := FALSE;
			(*----------------------------------------*)
		END_CASE
	END_IF
END_IF




IF xTB_Convert THEN
	xTB_Convert := FALSE;
// 	ACT_ConcatCartPosString();
// 	ACT_ConcatJointPosString();
// 	
// 	ACT_Quaternions();

	ACT_JointsInRadians();
