		pst1 := ADR(sLocationName), 
		pst2 := ADR(c_sBufferTypeKey), 
		uiSearchStart := 0 
	);
	xIsBuffer := iBufferKeyFound > 0;
	IF xIsBuffer THEN
		MappingInfo.eType := sorter_elem_type_enum_t.Buffer;

		// identify which sorter section
		sBackSectionKey := CONCAT('-', CONCAT(c_sFirstSectionName, '-'));
		sFrontSectionKey := CONCAT('-', CONCAT(c_sSecondSectionName, '-'));
		xIsBackSection := FIND(sLocationName, sBackSectionKey) > 0;
		xIsFrontSection := FIND(sLocationName, sFrontSectionKey) > 0;
		xValidSection := xIsBackSection OR xIsFrontSection;

		IF xValidSection THEN
			IF xIsFrontSection THEN
				MappingInfo.Info.BufferInfo.iSectionIndex := 1;
			ELSE
				MappingInfo.Info.BufferInfo.iSectionIndex := 0;
			END_IF

			// identify buffer number
			iBufferNum := METH_FindBufferNum(
				sLocationName := sLocationName
			);
			xValidBufferNum := iBufferNum > 0;
			IF xValidBufferNum THEN
				MappingInfo.Info.BufferInfo.iNumber := iBufferNum;

				// identify buffer depth
				iBufferDepth := METH_FindBufferDepth(
					sLocationName := sLocationName
				);
				xValidBufferDepth := iBufferDepth >= 0;
				IF xValidBufferDepth THEN
					 MappingInfo.Info.BufferInfo.iDepth := iBufferDepth;
				ELSE
					eRes := sorter_mapping_error_enum_t.INVALID_BUFFER_DEPTH;
				END_IF
			ELSE
				eRes := sorter_mapping_error_enum_t.INVALID_BUFFER_NUMBER;
			END_IF
		ELSE
			eRes := sorter_mapping_error_enum_t.INVALID_BUFFER_SECTION;
		END_IF
	ELSE // check if CONVEYOR
		iMaxIndConv := c_iMaxIndConv;
		xIsConveyor := FALSE;
		FOR iIndConv := 0 TO iMaxIndConv DO
			aiConveyorKeyFound[iIndConv] := STU.StrCaseFindA(
				pst1 := ADR(sLocationName), 
				pst2 := ADR(c_asConveyorTypeKey[iIndConv]), 
				uiSearchStart := 0 
			);
			xIsConveyor := xIsConveyor OR (aiConveyorKeyFound[iIndConv] > 0);
			IF xIsConveyor THEN
				EXIT;
			END_IF
		END_FOR
		IF xIsConveyor THEN
			MappingInfo.eType := sorter_elem_type_enum_t.Conveyor;
			xIsGate := STU.StrCaseFindA(
				pst1 := ADR(sLocationName), 
				pst2 := ADR(c_asConveyorTypeKey[0]), 
				uiSearchStart := 0 
			) > 0;
