				ELSE
					eRes := sorter_mapping_error_enum_t.INVALID_LOCATION_NAME;
				END_IF
			END_IF
		ELSE
			eRes := sorter_mapping_error_enum_t.INVALID_LOCATION_NAME;
		END_IF
	END_IF
ELSE
	eRes := sorter_mapping_error_enum_t.INVALID_INPUT;
