		REFFeedback.error := TRUE;
		REFFeedback.aborted := FALSE;
		REFFeedback.error_id := prgLifter01.METH_GetLastErrorID();
	ELSIF xAborted THEN
		xAborted := FALSE;
		REFFeedback.done := FALSE;
		REFFeedback.error := FALSE;
		REFFeedback.aborted := TRUE;
		REFFeedback.error_id := prgLifter01.METH_GetLastErrorID();
	ELSE
		REFFeedback.busy := prgLifter01.METH_IsOccupied();
	END_IF
ELSE
	METH_ClearFeedback();
END_IF

// catch triggers of ROS Command

xExecuteTrigger := REFCommand.execute AND GVL.g_xRUNNING;
R_TRIG_Command(CLK := xExecuteTrigger);
IF R_TRIG_Command.Q THEN
	METH_ClearFeedback();
	prgFeeding_B.METH_DoNewCycle();
END_IF

IF xExecuteTrigger THEN
	IF xSuccess OR xBusy THEN // immediate response as soon as busy
		xSuccess := FALSE;
		REFFeedback.done := TRUE;
		REFFeedback.error := FALSE;
		REFFeedback.aborted := FALSE;
	ELSIF xFailure THEN
		xFailure := FALSE;
		REFFeedback.done := FALSE;
		REFFeedback.error := TRUE;
		REFFeedback.aborted := FALSE;
	ELSIF xAborted THEN
		xAborted := FALSE;
		REFFeedback.done := FALSE;
		REFFeedback.error := FALSE;
		REFFeedback.aborted := TRUE;
	ELSE
		REFFeedback.busy := prgFeeding_B.METH_IsOccupied();
	END_IF
ELSE
	METH_ClearFeedback();
END_IF

IF xSimulation THEN
	REFFeedback REF= SIMFeedback;
	REFCommand REF= SIMCommand;
ELSE
	REFFeedback REF= prgROS.ROSInterface_01.Codesys2ROS.Published.lifter_controller_feedback;
	REFCommand REF= prgROS.ROSInterface_01.ROS2Codesys.Subscripted.lifter_controller_command;
END_IF


IF __ISVALIDREF(REFFeedback) AND __ISVALIDREF(REFCommand) THEN
(*======================================*)
	diActionID := REFCommand.id;
	ACT_SerialROSResponse();
// 	CASE diActionID OF
// 		1: // serial action
// 			ACT_SerialROSResponse();
// 		2: // execute and immediate response (at least busy or failed)
// 			ACT_ImmediateROSResponse();
// 		ELSE
// 			ACT_SerialROSResponse();
// 	END_CASE
END_IF

IF __ISVALIDREF(REFFeedback) THEN
	SysMemSet(pDest := ADR(REFFeedback), udiCount := XSIZEOF(REFFeedback), udiValue := 0);
END_IF

xSuccess := FALSE;
xFailure := FALSE;
xAborted := FALSE;
xBusy :=  FALSE;

R_TRIG_Execute(CLK := CTRL_Axis.xExecute);
F_TRIG_Execute(CLK := CTRL_Axis.xExecute);

R_TRIG_Abort(CLK := xSimTimeCond AND CTRL_Axis.xAbort);
F_TRIG_Abort(CLK := CTRL_Axis.xAbort);

IF R_TRIG_Execute.Q THEN
	xSimTimeCond := TRUE;
	prgROS.METH_SetLifterVelocity_01(lrValue := 100.0);
	prgROS.METH_SetLifterEffort_01(lrValue := 2.0);
	xValidAction := TRUE;
	CASE diActionID OF
				0:
					lrTargetPosition := 0.0;
				1:
					lrTargetPosition := 300.0;
				2:
					lrTargetPosition := 600.0;
		ELSE
			xValidAction := FALSE;
	END_CASE
END_IF
IF R_TRIG_Abort.Q THEN
	xAbortNow := TRUE;
END_IF
TON_Sim(IN := xSimTimeCond, PT := tSim, ET => tElapsed);

lrCurrentPos := TO_REAL(prgROS.METH_GetLifterPosition_01());
// simulate position increment
IF xSimTimeCond THEN
	IF xValidAction THEN
		IF lrCurrentPos < lrTargetPosition THEN
			rMin := TO_REAL(lrCurrentPos);
			rMax := TO_REAL(lrTargetPosition);
		ELSE
			rMin := TO_REAL(lrTargetPosition);
			rMax := TO_REAL(lrCurrentPos);
		END_IF

		LIN_TRAFO_Pos(
			IN := TO_REAL(tElapsed),
			IN_MIN := 0.0,
			IN_MAX := TO_REAL(tSim),
			OUT_MIN := rMin,
			OUT_MAX := rMax,
			OUT => rOutPos,
			ERROR => xErrorTrafo		
		);
		IF NOT xErrorTrafo THEN
			IF lrCurrentPos <> lrTargetPosition THEN
				IF lrCurrentPos < lrTargetPosition THEN
					lrPos := TO_LREAL(rOutPos);
				ELSE
					lrPos := lrCurrentPos - TO_LREAL(rOutPos);
				END_IF
			END_IF
			prgROS.METH_SetLifterPosition_01(lrValue := lrPos);
		END_IF
	END_IF
END_IF

IF TON_Sim.Q THEN
	TON_Sim(IN := FALSE);
	xSimTimeCond := FALSE;
	CASE diActionID OF
		0, 1, 2:
			prgROSInterfaceToLifter01.METH_SetSuccess();
			diLastErrorID := 0;
			// Set joint states
			prgROS.METH_SetLifterPosition_01(lrValue := lrTargetPosition);
		ELSE
			prgROSInterfaceToLifter01.METH_SetFailure();
			diLastErrorID := 1;
	END_CASE

	prgROS.METH_SetLifterVelocity_01(lrValue := 0.0);
	prgROS.METH_SetLifterEffort_01(lrValue := 1.0);

	CTRL_Axis.xExecute := FALSE;
	CTRL_Axis.xAbort := FALSE;
ELSIF xAbortNow THEN
	xAbortNow := FALSE;
	xSimTimeCond := FALSE;
	prgROSInterfaceToLifter01.METH_SetAborted();
	diLastErrorID := -1;

	prgROS.METH_SetLifterVelocity_01(lrValue := 0.0);
	prgROS.METH_SetLifterEffort_01(lrValue := 1.0);

	CTRL_Axis.xExecute := FALSE;
	CTRL_Axis.xAbort := FALSE;
END_IF

prgROS.METH_SetLifterName_01(sValue := c_sLifterName, iIndex := c_iLifterIndex);
IF xSimulation THEN
	ACT_Simulation();
ELSE
	//
END_IF

JointStates := prgROS.ROSInterface_01.Codesys2ROS.Published.lifter_controller_joint_states;
iIndex := prgLifter01.c_iLifterIndex;
sName := JointStates.name[iIndex];
lrPosition := JointStates.position[iIndex];
lrVelocity := JointStates.velocity[iIndex];
lrEffort := JointStates.effort[iIndex];

IF __ISVALIDREF(prgROSInterfaceToLifter01.REFCommand) THEN
	Command := prgROSInterfaceToLifter01.REFCommand;
END_IF

IF __ISVALIDREF(prgROSInterfaceToLifter01.REFFeedback) THEN
	Feedback := prgROSInterfaceToLifter01.REFFeedback;
END_IF
